import React, { useState, useRef } from "react";
import axios from "axios";
import "./App.css"; // import styles

function App() {
  const [results, setResults] = useState(null);
  const [liveScanActive, setLiveScanActive] = useState(false);
  const [frameCount, setFrameCount] = useState(0);
  const [maxFrames] = useState(5); // frames before auto-stop
  const [capturedFrames, setCapturedFrames] = useState([]);
  const videoRef = useRef(null);
  const canvasRef = useRef(null);
  let intervalId = useRef(null);

  // Upload single image
  const handleUpload = async (e) => {
    const file = e.target.files[0];
    if (!file) return;

    const formData = new FormData();
    formData.append("image", file);

    const res = await axios.post("http://127.0.0.1:5000/upload", formData);
    setResults(res.data);
  };

  // Start live scan
  const startLiveScan = async () => {
    setResults(null);
    setCapturedFrames([]);
    setFrameCount(0);
    setLiveScanActive(true);

    try {
      const stream = await navigator.mediaDevices.getUserMedia({ video: true });
      if (videoRef.current) {
        videoRef.current.srcObject = stream;
        videoRef.current.play();
      }

      intervalId.current = setInterval(captureFrame, 3000); // every 3s
    } catch (err) {
      console.error("Error accessing camera:", err);
    }
  };

  // Capture one frame
  const captureFrame = () => {
    if (!videoRef.current || !canvasRef.current) return;

    const video = videoRef.current;
    const canvas = canvasRef.current;
    const ctx = canvas.getContext("2d");

    canvas.width = video.videoWidth;
    canvas.height = video.videoHeight;
    ctx.drawImage(video, 0, 0, canvas.width, canvas.height);

    const dataUrl = canvas.toDataURL("image/jpeg");
    setCapturedFrames((prev) => [...prev, dataUrl]);
    setFrameCount((prev) => prev + 1);

    if (frameCount + 1 >= maxFrames) {
      stopLiveScan();
    }
  };

  // Stop scan → send frames
  const stopLiveScan = async () => {
    setLiveScanActive(false);
    clearInterval(intervalId.current);

    if (videoRef.current && videoRef.current.srcObject) {
      videoRef.current.srcObject.getTracks().forEach((track) => track.stop());
    }

    if (capturedFrames.length > 0) {
      try {
        const res = await axios.post("http://127.0.0.1:5000/upload-frames", {
          frames: capturedFrames,
        });
        setResults(res.data);
      } catch (err) {
        console.error("Error sending frames:", err);
      }
    }
  };

  return (
    <div className="app-container">
      <h1 className="title">🌸 AllerLens</h1>

      {/* Upload */}
      <div className="upload-section">
        <label className="upload-label">
          Upload Product Image:
          <input type="file" accept="image/*" onChange={handleUpload} />
        </label>
      </div>

      {/* Live scan */}
      <div className="live-scan">
        {!liveScanActive ? (
          <button className="btn start" onClick={startLiveScan}>
            📷 Start Live Scan
          </button>
        ) : (
          <button className="btn stop" onClick={stopLiveScan}>
            ⏹ Stop Live Scan
          </button>
        )}

        {liveScanActive && (
          <div className="video-section">
            <video ref={videoRef} width="400" height="300" />
            <canvas ref={canvasRef} style={{ display: "none" }} />
            <p className="status">
              Captured {frameCount}/{maxFrames} frames...
            </p>
          </div>
        )}
      </div>

      {/* Results */}
      {results && (
        <div className="results">
          <h2>⚠️ Detected Allergens</h2>
          {results.flagged_ingredients?.length > 0 ? (
            <ul>
              {results.flagged_ingredients.map((ing, i) => (
                <li key={i}>{ing}</li>
              ))}
            </ul>
          ) : (
            <p>No allergens found 🎉</p>
          )}
        </div>
      )}
    </div>
  );
}

export default App;
